import React, { useState } from 'react';
import axios from 'axios';
import '../styles/Login.css';

const Login = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [role, setRole] = useState('');
  const [errorMessage, setErrorMessage] = useState('');

  const handleLogin = async (e) => {
    e.preventDefault();

    // Error if no role is selected
    if (!role) {
      setErrorMessage('Please select a role.');
      return;
    }

    const loginData = { username, password, role };

    try {
      const response = await axios.post('http://localhost:8080/api/login', loginData);
      const { role: responseRole, id } = response.data;

      switch (responseRole) {
        case 'ADMIN':
          window.location.href = `/admin/${id}`;
          break;
        case 'ARTIST':
          window.location.href = `/artist/${id}`;
          break;
        case 'VISITOR':
          window.location.href = `/visitor/${id}`;
          break;
        case 'CURATOR':
          window.location.href = `/curator/${id}`;
          break;
        default:
          window.location.href = '/login';
          break;
      }
    } catch (error) {
      setErrorMessage(error.response?.data?.message || 'Login failed. Please try again.');
    }
  };

  return (
    <div className="login-container">
      <form onSubmit={handleLogin}>
        <div>
          <h2 style={{ color: 'white', fontSize: '30px', textAlign: 'center' }}>Login</h2>
          <label style={{ color: 'white', fontSize: '15px' }}>Username</label>
          <input
            type="text"
            style={{ backgroundColor: 'white', color: 'black' }}
            placeholder="Enter your username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
        </div>
        <div>
          <label style={{ color: 'white', fontSize: '15px' }}>Password</label>
          <input
            type="password"
            style={{ backgroundColor: 'white', color: 'black' }}
            placeholder="Enter your password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>
        <div>
          <label style={{ color: 'white', fontSize: '15px' }}>Role</label>
          <select
            style={{ backgroundColor: 'white', color: 'black' }}
            value={role}
            onChange={(e) => setRole(e.target.value)}
            required
          >
            <option value="" disabled>
              Select Role
            </option>
            <option value="ADMIN">Admin</option>
            <option value="ARTIST">Artist</option>
            <option value="VISITOR">Visitor</option>
            <option value="CURATOR">Curator</option>
          </select>
        </div>
        {errorMessage && (
          <p style={{ color: 'red', fontWeight: 'bold', textAlign: 'center' }}>
            {errorMessage}
          </p>
        )}
        <div className="login-button">
          <button
            type="submit"
            disabled={!username || !password || !role} // Disable until all fields are filled
          >
            <span style={{ fontWeight: 'bold' }}>LOGIN</span>
          </button>
        </div>
        <p style={{ marginTop: '10px', color: 'white' }}>
          Don't have an account?{' '}
          <a href="/register" style={{ color: 'lightblue' }}>
            Create one here
          </a>
        </p>
      </form>
    </div>
  );
};

export default Login;
